import React from "react";

const RepositoryItem = ({ name, linkToRepo, fullName }) => {
  return (
    <div>
      <h2>01-js-foundations-solution</h2>
      <h4>full name:</h4>
      <a href={linkToRepo} target="blank" rel="noreferrer">
        {fullName}
      </a>
    </div>
  );
};

export default RepositoryItem;
